  false,\n\t\"url\": null,\n\t\"notes\": \"The San Joaquin Valley had the potential
  for a severe botulism outbreak, but intensive management efforts kept losses to
  45,000 birds. Outbreaks in the Sacramento Valley and the Klamath Basin caused the
  death of 84,000 and 11,000 waterfowl respectively. Total losses in the state were140,000
  and an estimated 500,000 waterfowl were saved by management techniques. The extensive
  cooperative control program of the U. S. Bureau of Sport Fisheries and Wildlife
  and the California Department of Fish and Game including agency costs is presented.
  Biology of the individual outbreaks is discussed briefly.\",\n\t\"license_title\":
